import { Directive, OnDestroy } from '@angular/core';
import { AbstractControl, ControlValueAccessor, ValidationErrors, Validator } from '@angular/forms';

import { Subject, takeUntil } from 'rxjs';

import { FormComponentBase } from './form-component-base.class';

@Directive()
export abstract class CustomControlBase<T> extends FormComponentBase implements ControlValueAccessor, Validator, OnDestroy {

  private readonly _unsubscribe$ = new Subject<void>();

  public writeValue(value: T): void {
    value && this.form.setValue(value, { emitEvent: false });
  }

  public onTouched: (_: T) => void = () => {};

  public registerOnChange(onChange: (_: T) => void): void {
    this.form.valueChanges
      .pipe(takeUntil(this._unsubscribe$))
      .subscribe(onChange);
  }

  public registerOnTouched(fn: (_: T) => void): void {    
    this.onTouched = fn;
  }

  public validate(_: AbstractControl): ValidationErrors | null {
    return this.form.invalid ? { invalid: true } : null;
  }

  public ngOnDestroy(): void {
    this._unsubscribe$.next();
    this._unsubscribe$.complete();    
  }
}

import { Directive, ElementRef, HostListener } from '@angular/core';
import { NgControl } from '@angular/forms';

@Directive({
  selector: '[firstCapitalLetter]',
  standalone: true,
})
export class FirstCapitalLetterDirective {
  constructor(public ref: ElementRef, private readonly control: NgControl) {}

  @HostListener('input', ['$event'])
  transformToUppercase(): void {
    const inputEl = this.ref.nativeElement.value;
    this.control.control?.setValue(
      inputEl.substring(0, 1).toUpperCase() + inputEl.substring(1).toLowerCase()
    );
  }
}

import { Directive } from "@angular/core";
import { FormGroup } from "@angular/forms";

@Directive()
export abstract class FormComponentBase {
    public abstract form: FormGroup;

    public flush(controlName: string): void {
        this.form.get(controlName)?.reset(null);
    }
}

import { Directive, ElementRef, HostListener, Renderer2 } from '@angular/core';

@Directive({
  selector: '[toUppercase]',
  standalone: true,
})
export class ToUppercaseDirective {
  constructor(public ref: ElementRef, private readonly renderer: Renderer2) {}

  @HostListener('input', ['$event'])
  transformToUppercase(): void {    
    const inputValue = this.ref.nativeElement.value;
    this.renderer.setProperty(this.ref.nativeElement, 'value', inputValue.toUpperCase());
  }
}

